_source.ingredients:
Creme hvit mini: skummetmelk, kremfløte (20%), sukker, kakaosmør, helmelkpulver, skummetmelkpulver, glukose, melkefett, emulgator (mono- og diglyserider av fettsyrer, soyalecitin), vanilje-ekstrakt, aromaer, stabilisator (cellulosegummi, guarkjernemel, karragenan), vaniljekorn, fargestoff (annatto norbixin).;
creme mandel mini: skummetmelk, sukker, kremfløte (19%), kakaosmør, helmelkpulver, mandler (4,2%), skummetmelkpulver, kakaomasse, glukose, rapsolje, emulgator (mono- og diglyserider av fettsyrer, e476, soyalecitin, solsikkelecitin), vanilje-ekstrakt, aromaer, stabilisator (cellulosegummi, guarkjernemel, karragenan), vaniljekorn, fargestoff (annatto norbixin).;
creme mørk mini: skummetmelk, kremfløte (20%), sukker, kakaosmør, skummetmelkpulver, kakaomasse, glukose, fettredusert kakao, rapsolje, emulgator (mono- og diglyserider av fettsyrer, solsikkelecitin, e476), vanilje-ekstrakt, stabilisator (cellulosegummi, guarkjernemel, karragenan), aromaer, vaniljekorn, fargestoff (annatto norbixin).

