2x karamellis i søt risdeig: helmelk, smørkaramell, smør, fløte, laktose, melkeproteiner, eggeplomme, eggehvitepulver;
2x mangosorbet i søt risdeig: eggehvitepulver;
2x jordbæris i søt risdeig: helmelk, fløte, laktose, melkeproteiner, eggehvitepulver

_source.ingredients:
2x karamellis i søt risdeig: helmelk, smørkaramell (15 %) (glukosesirup, sukker, smør, vann, fløte, salt), fløte, sukker, vann, rismel (7,8 %), trehalose*, laktose, melkeproteiner, dehydrert glukosesirup, eggeplomme, karamell (0,7 %) (vann, sukker), potetstivelse, eggehvitepulver, emulgator (e471), stabilisatorer (e410, e412), salt. *trehalose er en kilde til glukose.;
2x mangosorbet i søt risdeig: alphonso mangopuré (29 %), vann, sukker, rismel (7,7 %), trehalose*, dekstrose, dehydrert glukosesirup, potetstivelse, sitronjuice, eggehvitepulver, stabilisatorer (e412, e415), hydrolysert erteprotein, gresskar- og eplekonsentrat. *trehalose er en kilde til glukose.;
2x jordbæris i søt risdeig: helmelk, sukker, fløte, jordbærpuré (13 %), vann, rismel (7,7 %), laktose, melkeproteiner, trehalose*, dehydrert glukosesirup, potetstivelse, gresskar-, eple- og rødbetekonsentrat, eggehvitepulver, emulgator (e471), stabilisator (e410, e412), aroma (naturlig jordbæraroma og andre naturlige aromaer). *trehalose er en kilde til glukose.
